2012

Arquitectura: Arq. Luis Landaeta @lamd.ca / Arq. Msc. Diego López @arqdiegobytes
Ingeniería Estructural: Dr. Ing. Eli Saúl Hernández @elih.ramos18
Ingeniería Eléctrica: Ing. Juan Pedro Peraza
Ingeniería Sanitaria: Félix Amado Landaeta
Diseño Interior: Ruth De Ceconello @ruthcecconello
Renderizado: Arq. Msc. Diego López @arqdiegobytes
Construcción: Luis Landaeta - Félix Amado Landaeta
Fotografía: Jackson Orellano @ Jacksonorellano

La inmensidad del piedemonte que se conjuga con la llanura, puede observarse desde esta 
vivienda basada íntegramente en aprovechar la visual que se posee. Así, formalmente es una 
composición de techos con ventanales que se extiende a lo largo del paisaje. Esos mismos techos 
en el interior parecen que volaran al presentarse en un mono espacio libre de estructura, donde la 
sala es el nodo que integra los espacios sociales y en donde solo aparecen paredes al llegar a las 
habitaciones.

Los ventanales son los protagonistas, la luz natural de manera frontal o cenital está en todas las 
áreas de la vivienda. Estar adentro y sentir la libertad del afuera es una característica principal de 
esta edificación.

